import '../css/Header.css';
import {Link} from "react-router-dom";


const Header = () => {
    return (
        <div className='Header'>
            <Link id='headerLink' to='/'> STRUGGLE ON WORDLE TOGETHER </Link>
        </div>
    );
}

export default Header;
